    top: 0px;
    left: 0px;
`;

const Image2 = styled.img`
    width: 100%;
    height: 100%;

    position: absolute;
    top: 0px;
    left: 0px;
`;


const Image3 = styled.img`
    width: 100%;
    height: 100%;

    position: absolute;
    top: 0px;
    left: 0px;
`;

const MyWeb = () => {
    return <section>
        {/* 이미지와 텍스트를 관리 할 수 있게 한다. */}
